// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract FeeMonitor {
    struct FeeTransaction {
        uint256 timestamp;
        uint256 amount;
        address deployer;
    }

    FeeTransaction[] public transactions;
    mapping(address => uint256) public deployerFees;
    uint256 public totalFees;
    uint256 public totalDeployments;

    event FeeCollected(
        address indexed deployer,
        uint256 amount,
        uint256 timestamp
    );

    function recordFee(address deployer, uint256 amount) external {
        transactions.push(FeeTransaction({
            timestamp: block.timestamp,
            amount: amount,
            deployer: deployer
        }));

        deployerFees[deployer] += amount;
        totalFees += amount;
        totalDeployments += 1;

        emit FeeCollected(deployer, amount, block.timestamp);
    }

    function getAnalytics() external view returns (
        uint256 _totalFees,
        uint256 _totalDeployments,
        FeeTransaction[] memory _recentTransactions
    ) {
        uint256 length = transactions.length;
        uint256 recentCount = length > 10 ? 10 : length;
        FeeTransaction[] memory recent = new FeeTransaction[](recentCount);

        for (uint256 i = 0; i < recentCount; i++) {
            recent[i] = transactions[length - recentCount + i];
        }

        return (totalFees, totalDeployments, recent);
    }
}

contracts/TokenSale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TokenSale is ReentrancyGuard, Ownable {
    IERC20 public token;
    uint256 public tokenPrice;
    uint256 public hardCap;
    uint256 public totalSold;
    bool public saleActive;

    constructor(
        address _token,
        uint256 _tokenPrice,
        uint256 _hardCap
    ) {
        token = IERC20(_token);
        tokenPrice = _tokenPrice;
        hardCap = _hardCap;
        saleActive = true;
    }

    function purchaseTokens() external payable nonReentrant {
        require(saleActive, "Sale is not active");
        require(msg.value > 0, "Amount must be greater than 0");
        require(totalSold < hardCap, "Hard cap reached");

        uint256 tokenAmount = (msg.value * (10**18)) / tokenPrice;
        require(token.balanceOf(address(this)) >= tokenAmount, "Insufficient tokens in contract");

        totalSold += tokenAmount;
        token.transfer(msg.sender, tokenAmount);
    }

    // Other necessary functions (withdraw, emergency stop, etc.)
}

